import style from "./Button.module.css"

function Button() {
    const { onClick, children, title, disabled = false} = this.props.
    return (
    <button 
        className={style.button} 
        onClick={onClick} 
        title={title} 
        disabled={disabled}
    >
        {children}
    </button>
    )
}

export default Button;
